import { Link } from 'react-router-dom'
import './header.css'

const Header = () => {

    const login_button = document.getElementById("join_button")
    return(
        <header>
            <p id="join_button"><Link to="/login">로그인 / 회원가입</Link></p>
            
        </header>
    )
}

export default Header;
